⚡️⚡️ Medwedew dazu, dass der Ukraine nun Raketen mit großer Reichweite geliefert werden:

- Die Antwort im Falle von Angriffen auf die Krim und dem russischen Festland wird schnell, hart und überzeugend sein;

- Russland setzt seiner Reaktion auf Angriffe keine Grenzen und ist bereit, je nach Art der Bedrohung alle Arten von Waffen einzusetzen;

- Wenn die Ukraine versucht, die Krim anzugreifen, wird es Vergeltungsschläge geben, und die gesamte unter Kiewer Herrschaft verbleibende Ukraine wird in Flammen aufgehen;

- Diejenigen, die glauben, dass die Entsendung von Waffen in die Ukraine dem Westen helfen wird, Verhandlungen aufzunehmen, liegen falsch.

