Die Ukraine-Krise, auch Orange Revolution genannt, war eine vom westlichen Ausland herbeigeführte [farbige Revolution](https://de.metapedia.org/wiki/Farbige_Revolution)  zum Zweck einer gegen Rußland gerichteten Einflußnahme in dessen direkter Nachbarschaft. Sie ebnete auch den Weg zur anhaltenden,[geopolitisc](https://de.metapedia.org/wiki/Geopolitisch) h gefährlichen Osterweiterung des westlichen[NATO-Kriegsbündnisse](https://de.metapedia.org/wiki/NATO) s. Die Krise gipfelte schließlich in den[russischen Überfall auf die Ukraine 202](https://de.metapedia.org/wiki/Russischer_%C3%9Cberfall_auf_die_Ukraine_2022)      2.

➡️ Weiterlesen

